function s45_import_attachment_array(){
	global $wpdb;
	$images = s45_attachments_array();
	if(!empty($images)){
		foreach ($images as $image) :
			// Get the path to the upload directory.
			$wp_upload_dir = wp_upload_dir();
			
			$filename1 = $image['guid'];
			
			// The ID of the post this attachment is for.
			$parent_post_id = $image['post_parent'];

			// Check the type of file. We'll use this as the 'post_mime_type'.
			$filetype1 = $image['post_mime_type'];
			
			$post_title = $image['post_title'];

			// Prepare an array of post data for the attachment before image
			$attachment1 = array(
				'guid'           => $filename1, 
				'post_mime_type' => $filetype1,
				'post_title'     => $post_title,
				'post_content'   => '',
				'post_status'    => 'inherit'
			);

			// Insert the attachment.
			$attach_id1 = wp_insert_attachment( $attachment1, $filename1, $parent_post_id );
			
			// Make sure that this file is included, as wp_generate_attachment_metadata() depends on it.
			require_once( ABSPATH . 'wp-admin/includes/image.php' );

			// Generate the metadata for the attachment, and update the database record.
			$attach_data1 = wp_generate_attachment_metadata( $attach_id1, $filename1 );
			wp_update_attachment_metadata( $attach_id1, $attach_data1 );
			set_post_thumbnail( $parent_post_id, $attach_id1 );
			echo $image['ID'].'<br>';
		endforeach;
	}
}

